import {
  IonButton,
  IonCol,
  IonGrid,
  IonInput,
  IonItem,
  IonLabel,
  IonRow,
} from "@ionic/react";
import React from "react";

interface Admin{
    name: string;
    surname: string;
    cellNum: string;
    password: string;
}

const AdminForm: React.FC<{ buttonName: string, content: Admin}> = (props) => {
    const {name, surname, cellNum, password} = props.content;
    let url;

    if (props.buttonName === "Update"){
        url = "/dashboard";
    }
    else{
        url = "/signIn";
    }
  return (
    <IonGrid>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Name</IonLabel>
            <IonInput type="text" value={name}></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Surname</IonLabel>
            <IonInput type="text" value={surname}></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Cell Number</IonLabel>
            <IonInput type="text" value={cellNum}></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Password</IonLabel>
            <IonInput type="password" value={password}></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating">Confrim Password</IonLabel>
            <IonInput type="password" value={password}></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonButton href={url} type="submit" expand="block">
            {props.buttonName}
          </IonButton>
        </IonCol>
      </IonRow>
    </IonGrid>
  );
};

export default AdminForm;
